import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return (
      <div className="ui secondary pointing menu">
        <Link to="/pages/videos" className="item">
          Videos
        </Link>
        <Link to="/pages/photos" className="item">
          Photos
        </Link>
        <Link to="/pages/music" className="item">
          Music
        </Link>
        <Link to="/pages/bio" className="item">
          Bio
        </Link>
        <div className="navbar"></div>
      </div>
  );
};

export default Header;
